import React, { useContext, useEffect, useState } from 'react'

export default ContactsHandler = contactInfo => {
    const [contacts, useContacts] = useState(null)

    useEffect(()=>{
        useContacts({...contacts, contactInfo})

    },[contactInfo])

return contacts
}
